import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { RegisterComponent } from './register/register.component';
import { LoginComponent } from './login/login.component';
import { RouterLink } from '@angular/router';
import { HomeComponent } from './home/home.component';
import { FormsModule } from '@angular/forms';
import { HttpClientModule } from  '@angular/common/http';
import { MemberViewComponent } from './member/member-view/member-view.component';
import { TrainerViewComponent } from './trainer/trainer-view/trainer-view.component';
import { AdminViewComponent } from './admin/admin-view/admin-view.component';
import { SalutationPipe } from './pipes/salutation.pipe';
import { UserImagePipe } from './pipes/user-image.pipe';
import { HidePasswordPipe } from './pipes/hide-password.pipe';


@NgModule({
  declarations: [
    AppComponent,
    RegisterComponent,
    LoginComponent,
    HomeComponent,
    MemberViewComponent,
    TrainerViewComponent,
    AdminViewComponent,
    SalutationPipe,
    UserImagePipe,
    HidePasswordPipe,
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    RouterLink,
    FormsModule,
    HttpClientModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
